(35, 1, '2020-04-04 16:49:33', '2020-04-04 19:49:33', '<div class=\"single_field\">\r\n[text* nome placeholder \"Insira seu nome\"]\r\n</div>\r\n<div class=\"single_field\">\r\n[text* email placeholder \"Insira seu email\"]\r\n</div>\r\n<div class=\"single_field m-0\">\r\n[textarea* mensagem cols 30 rows 10 placeholder \"Aqui você fala com a gente :)\"]\r\n</div>\r\n<p>Estou interessado e quero receber mais notícias sobre a empresa!</p>\r\n<div class=\"form_btn\">\r\n[submit class:boxed-btn3 \"ENVIAR\"]\r\n</div>\n1\nProcópio Engenharia \"Mensagem de Contato\"\n[nome] <[email]>\nprocopioengenharia@gmail.com\n[mensagem]\n\n\n\n\n\nProcópio Engenharia \"[your-subject]\"\nProcópio Engenharia <includejunior@gmail.com>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Procópio Engenharia (http://localhost/Projeto%20Procopio/site-procopio-wp/)\nReply-To: includejunior@gmail.com\n\n\n\nAgradecemos pela mensagem, entraremos em contato assim que possível :)\nOps! Ocorreu algum erro durante o envio  :( Por favor tente novamente\nUm ou mais campos estão incorretos. Verifique e tente novamente\nOcorreu um erro durante o envio. Tente novamente mais tarde.\n\nEsse campo é obrigatório preencher\n\n\nO formato de data está incorreto.\nA data é anterior à mais antiga permitida.\nA data é posterior à maior data permitida.\nOcorreu um erro desconhecido ao enviar o arquivo.\nVocê não tem permissão para enviar esse tipo de arquivo.\nO arquivo é muito grande.\nOcorreu um erro ao enviar o arquivo.\nO formato de número é inválido.\nO número é menor do que o mínimo permitido.\nO número é maior do que o máximo permitido.\nA resposta para o quiz está incorreta.\nO endereço de e-mail informado é inválido.\nA URL é inválida.\nO número de telefone é inválido.', 'Formulário de Contato', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2020-04-06 20:48:48', '2020-04-06 23:48:48', '', 0, 'http://localhost/Projeto%20Procopio/sit